INSERT INTO `mc_master` (`id`, `question`, `risk`, `photo`, `law`, `sts`, `create_by`, `create_date`, `modify_by`, `modify_date`, `cat_id`, `subcat_id`) VALUES
(1, 'Does the factory have a copy of valid laws and regulations on child labour and understand its requirements? 工廠有沒有一套有關童工的法律法規規定或清晰地理解有關童工的法律法規?', 'H', 'Y', '<中華人民共和國禁止使用童工規定法> China People''s Republic of prohibition of Child Labor ', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 14),
(2, 'What is the legal youngest (minimum) age of workers? 法定的童工最低的年齡是什麼?', 'H', 'Y', '<中華人民共和國禁止使用童工規定法> China People''s Republic of prohibition of Child Labor ', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 14),
(3, 'Does the factory have a copy of valid regulations and laws on young worker protection and understand its requirements? 工廠有沒有一套有關未成年工的法律法規規定或清晰地理解有關童工的法律法規?', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 14),
(4, 'Does the factory have effective procedures to verify the age of worker at the time of recruitment? 工廠有沒有一套程序文件有關核在新徵募職員時核對職員的年齡?', 'M', 'Y', '<中華人民共和國禁止使用童工規定法> China People''s Republic of prohibition of Child Labor ', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 14),
(5, 'Does the factory keep adequate age-supporting documents of workers such as ID copies and personnel records? 工廠有沒有保留足夠的年齡證名文件,例如:身分證,員工記錄?', 'M', 'Y', '<中華人民共和國禁止使用童工規定法> China People''s Republic of prohibition of Child Labor ', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 14),
(6, 'Is there a separate register required by law for young workers?有沒有法律規定未成年工必須有一個個別的登記記錄?', 'H', 'Y', '<中華人民共和國未成年人保護法> Republic of China on Protection of Young Workers Act', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 14),
(7, 'Is separate register maintained for young workers? 未成年工有沒有一個個別的登記記錄?', 'H', 'Y', '<中華人民共和國未成年人保護法> Republic of China on Protection of Young Workers Act', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 14),
(8, 'Is there any evidence identified that child labour is currently employed or has been employed in the past at the factory? 有沒有證據鑑定過去或現在有童工在工廠內工作的記錄?', 'H', 'Y', '<中華人民共和國禁止使用童工規定法> China People''s Republic of prohibition of Child Labor ', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 14),
(9, 'Does the youngest age of workers at the factory comply with statutory & regulatory requirements? 工廠內最年輕的人員能否滿足法律法規要求?', 'H', 'Y', '<中華人民共和國未成年人保護法> Republic of China on Protection of Young Workers Act', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 14),
(10, 'Are suspected young worker age records such as age certificate, local records or certificate from surgeon verified by the factory? 有嫌疑最年輕的人員的年齡證據名文件有否已被工廠證實?包括出世紙?', 'H', 'Y', '<中華人民共和國未成年人保護法> Republic of China on Protection of Young Workers Act', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 14),
(11, 'Are young workers engaged in hazardous work? 未成年工有沒有比安排有危險的工作?', 'H', 'Y', '<中華人民共和國未成年人保護法> Republic of China on Protection of Young Workers Act', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 14),
(12, 'Are young workers employed at night shift? 未成年工有沒有比安排夜班工作?', 'H', 'Y', '<中華人民共和國未成年人保護法> Republic of China on Protection of Young Workers Act', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 14),
(13, 'What is the time of night shift as defined by local law? 法律法規定立夜班工作為什麼時候?', 'H', 'Y', '<中華人民共和國國務院關於職工工作時間的規定> Republic of China State Council regulations on working hours of employees', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 14),
(14, 'Does the factory have a copy of valid laws and regulations on forced labor and understand its requirements? 工廠有沒有一套有關強迫和強制性勞動的法律法規規定或清晰地理解有關強迫和強制性勞動的法律法規?', 'L', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 15),
(15, 'Are all workers present voluntarily at the factory? 是不是所有的工人都是自動地在工廠工作?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 15),
(16, 'Are workers free to leave after working hours? 是不是所有的工人都可以在下班之後自由地出入工廠?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 15),
(17, 'Is there any restriction placed on leaving after working hours? 工人在下班之後有沒有地方不可以自由地出入?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 15),
(18, 'Where dormitories are present, are workers required to live in the dormitories without freedom of choice to live outside the factory? 如這間工廠是有宿舍，工人是否有選擇住在廠內或廠外的權利?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 15),
(19, 'When workers are in dormitories, is there any restriction placed on workers’ freedom of movement? 工人在宿舍裡，有沒有活動範圍限制規定?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 15),
(20, 'Are workers permitted time-off with doctor’s certificate or note when sick or for maternity? 工人如有醫生證明,可不可以請病假?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 15),
(21, 'Is there any evidence of physical or verbal abuse identified? 有沒有證據證明工廠內有肉體上或言語上的毀謗?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 15),
(22, 'Are workers forced to work overtime? 工人是不是被迫加班?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 15),
(23, 'Are employment contracts required by local law? 雇用合約是不是法律法規必須的?If employment contracts are required by law, does the law require that they shall be signed by both the factory AND the worker? 如雇用合約是法律法規必須的,那法規有沒有規定合約上必須有工廠及工人的簽署?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 15),
(24, 'Do all workers sign employment contracts with the factory? 是不是所有的工人都有跟工廠簽署雇用合約?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 15),
(25, 'Are employment contracts unfair or illegal? 工廠內的雇用合約是不是不公平的或不合法的?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 15),
(26, 'Is there any evidence identified that security guards were used to coerce workers? 工廠內的保安有沒有迫使工人做些什麼?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 15),
