(170, 'What is the maximum number of overtime hours worked by individual workers per month? 最多一個月的加班時間是什麼？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 19),
(171, 'When is the meal break of workers? 工人的飯休時間是什麼時候？', 'L', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 19),
(172, 'Do workers have time for rest breaks? 工人的休息是什麼時候？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 19),
(173, 'Is there any local legal requirement for meal breaks? 有沒有法律法規規定一定要飯休？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 19),
(174, 'Did the factory provide regulatory meal break? 工廠有提供飯休嗎?', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 19),
(175, 'Is there any local legal requirement for rest breaks? 有沒有法律法規規定一定要休息？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 19),
(176, 'Did the factory provide regulatory rest break? 工廠有提供休息時間嗎?', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 19),
(177, 'For legal requirement of extra overtime, does it need approval or permit from the relevant party? 對額外的加班時間的法律要求來說，它是否需要相關機構贊成或允許？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 19),
(178, 'Does the factory have any valid written approval or permit on extra overtime hours from local labour authority? 工廠有沒有有效的文件由相關機構贊成或允許額外加班時間？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 19),
(179, 'Do workers work overtime voluntarily? 是工人自願加班工作嗎？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 19),
(180, 'Is there any disciplinary action taken if workers refuse overtime? 如果工人拒絕加班，他們會有處分嗎？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 19),
(181, 'Does the factory have a copy of valid laws and regulations on non-discrimination and understand its requirements? 工廠有沒有一份有關嚴禁歧視的法律及法規列表或完全地了解有關嚴禁歧視的法律及法規要求?', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 17),
(182, 'Is there any evidence identified on discrimination in employment, promotion, compensation, welfare, dismissal and retirement, etc.? 有沒有證據顯示在僱用過程，入職過程，提高職級過程，賠償過程，解僱過程，退休過程存在歧視(不論原因，如宗教，種族，政治信仰，膚色，性別，年齡，婚姻狀態，懷孕，信念，殘障，性傾向或其他)', 'M', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 17),
(183, 'Does the employment of worker reflect local ethnic/religious population distribution  – no domination by one group? 就業的工人反映出本地種族/宗教人口分佈,不可能只有一組類型的工人得到就業？', 'H', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 17),
(184, 'Do supervisors in the facility reflect the ethnic/ religious even distributed from the worker population? 監督人在內設備反映出種族/ 宗教甚至從工人分佈的人口嗎？', 'H', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 17),
(185, 'Did employment records show any evidence of discrimination – patterns of dismissal? 就業記錄有沒有顯示解散是因為歧?的證據嗎？', 'H', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 17),
(186, 'Could workers access to procedures for filing complaints about discrimination? Are they familiar with this procedure? 工人可以回顧過去的抱怨編檔嗎？ 他們熟悉這個程序嗎？', 'H', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 17),
(187, 'Is equal salary for equal work implemented between male and female workers at the factory? 工廠的男工和女工的薪水相等嗎？', 'H', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 17),
(188, 'Is there any evidence of sexual harassment especially in young female workers? 有證據證明女工人有受到性騷擾嗎？', 'H', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 17),
(189, 'Is there any evidence identified on discrimination through interview with workers, individual and group? 透過與工人的會晤上鑑定，有證​​據證明有任何工人,個別和組受到歧視嗎？', 'H', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 17),
(190, 'Does the factory have a copy of valid laws and regulations on compensation and benefits and understand its requirements? 工廠有沒有一份有關賠償與津貼的法律及法規列表或完全地了解有關賠償與津貼的法律及法規要求?', 'H', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(191, 'Does the factory have written policy on compensation and benefits and communicate to all workers? 有關賠償與津貼的方針有沒有確立及通知所有的工人?', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(192, 'For the compensation and benefits policy, does it meet local laws and regulations on working hours? 工廠內的賠償與津貼政策可不可以滿足當地的標準工作法規要求?', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(193, 'What is the minimum wage at the factory? 最低工資是多少?', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(194, 'For the minimum wage of employees including trainees / apprentices / workers in probation period, does it meet the local requirement? 對在試用時期包括學員/ 學徒/ 工人的雇員的最低工資來說，它能滿足本地要求嗎？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(195, 'For the calculation method of compensation, did it communicate to all workers and clearly understood by them? 計算補償的方法，是否已經傳遞給全部工人並且清楚以他們理解？', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(196, 'Are the workers paid the regulatory overtime rates and wages? 加班費可不可以符合當地的法規要求?', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(197, 'Which kind of payment method for paying compensation & benefit to workers such as cash/ cheque/ autopay or any other means that convenient to workers?  支付補償是用那樣方法，例如現金/支票/自動轉賬還是那樣對工人方便的其他方法？', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(198, 'Did the workers receive the correct wage against the local regulatory requirement? 是不是所有的工人都可以滿足到當地的最低工資要求?', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(199, 'Are wage slips given to workers? Did they understand the wage break down details? 工資收據有給工人嗎？  他們理解工資的計算細節嗎？', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(200, 'Is there any mechanism to let workers checking/ verifying their wages? 有沒有程序可給工人證實他們的工資是正確的嗎？', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(201, 'Did the wage of workers deduct for any reason other than tax, social-security-fund? 除稅款，社保外, 工人的工資會因其他的原因而被扣除嗎？', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(202, 'Are these deductions fair, reasonable and legal? 這些扣除額是公正，合理和合法的嗎？', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(203, 'Did the payment frequency meet the legal requirement?薪資支付頻率滿足法律要求了嗎？', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(204, 'Would the factory withhold workers’ wages for any reason other than usual governmental requirement? 工廠將除了因為政府的要求外, 還會有其他的原因扣留工人的工資嗎？', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(205, 'Is there any extra overtime work done for meeting the production target without payment? 有沒有發現工廠沒有做加班費的情況？', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(206, 'Is there any evidence identified on wage payment by other means such as food or products?  有證據鑑定工資除了錢外還包括食品或是產品等？', 'M', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(207, 'Are all workers provided with social insurance per regulatory requirements? 是不是所有的工人都有按法規購買社保?', 'H', 'Y', '<中華人民共和國勞動法第九章社會保險和福利規定> PRC Chapter IX Labor Law Compensation and Benefits Code', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 4, 20),
(208, 'Are all the buildings constructed of materials which resist unlawful entry and protect against intrusion? 是否所有的建築物都能抵禦和防範非法入侵？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 5, 21),
(209, 'Do all the buildings have adequate locking devices on external and internal doors? 是否所有的建築物的門都有足夠的鎖緊裝置？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 5, 21),
(210, 'Are all the facilities enclosed by fencing?所有的設施都是用圍欄封閉？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 5, 23),
(211, 'Is there video camera surveillance in your facilities as well as receiving and loading docks?是否有攝像頭監視的設施，以及接收和攝像機視頻功能？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 5, 23),
