(519, 'Is there a periodical calibration plan and is it implemented (recall)? 是否有計劃，並定期校準（召回）', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 3),
(520, 'Is an up-to-date calibration tag attached to each M&TE tool? 是否有校準標籤貼在每個 TE的工具？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 4),
(521, 'Is there a plan for conducting internal quality audits and is it implemented? 是否有計劃進行內部質量審核和是否實施？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 5),
(522, 'Is an audit report submitted for each audit, including required corrective actions? 提交審計報告是在每次審核，包括所需的糾正措施？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 5),
(523, 'Is there follow-up on open corrective actions?是否有後續糾正行動？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 5),
(524, 'Is there a process for monitoring and controlling identified key characteristics?是否有一個過程的監測和控制確定的關鍵特徵是什麼？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 5),
(525, 'Is there a process for documenting the measurement requirements for product or service acceptance? 是否有一個過程的記錄測量要求的產品或服務的認同？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 5),
(526, 'Are there sampling inspections made and according to which standard? 是否有抽樣巡查次數，並根據哪些標準？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 5),
(527, 'Is there an SPC plan for processes and is it implemented? 是否有SPC計劃實施', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 4),
(528, 'Is there a positive recall system for product that is released prior to completion of all required measurement and monitoring activities? 是否有一個積極的回收制度，並在產品被釋放之前，完成所有必要的測量和監控活動？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 4),
(529, 'Do records provide evidence that the product meets the defined requirements? 是否有記錄提供證據證明產品符合規定的要求？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 4),
(530, 'Does the supplier perform First Article Inspections to include the inspection, verification and documentation of a representative item from the first production run of a new part? 供應商是否執行首件檢驗，包括檢驗，核查和文件有代表性的項目從最早生產運行一個新的零件？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 4),
(531, 'Does the documented procedure define the responsibility for review and the authority for dispositioning nonconforming product? 請問這個程序文件界定職責，審查和處理不合格產品？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 2),
(532, 'Is there a process for approving the personnel to make decisions regarding disposition of nonconforming product? 是否有一個過程負責審批的人員有權決定處置不合格產品？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 2);
INSERT INTO `mc_master` (`id`, `question`, `risk`, `photo`, `law`, `sts`, `create_by`, `create_date`, `modify_by`, `modify_date`, `cat_id`, `subcat_id`) VALUES
(533, 'Is there a process of disposition of nonconforming material, with the participation of all involved parties (MRB board)? 是否有一個過程，處置不合格材料，參與所有有關各方（如MRB小組）', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 4),
(534, 'Is the customer approving nonconforming material dispositions (if contractually required)? 是否需要客戶審批不合格的材料（如合同要求）', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 4),
(535, 'Is nonconforming material identified by "Nonconforming Material" tag? 不合格的材料是否有“不合格材料“的標籤', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 4),
(536, 'Is nonconforming material passed to segregated storage (MRB)? 不合格的材料是否有隔離存儲（如MRB）', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 4),
(537, 'Is there an up-to-date list of nonconforming material in the MRB segregation area? 不合格的材料隔離存儲是否有最新名單', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 4),
(538, 'Is there a mechanism for handling customer complaints? 是否有客戶投訴處理機制', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 1),
(539, 'Is there a mechanism for handling nonconforming product? 是否有一個機制，處理不合格產品', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 1),
(540, 'Is analysis Performed to identify root causes of problems/failures? 所完成是分析，是否有確定問題的根源', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 5),
(541, 'Is there action initiated to prevent recurrence of problems/failures? 是否有採取行動，防止再次發生啟動問題/失敗', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 5),
(542, 'Are problems/failures brought to management attention? 管理人員是否有注意質量問題', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 5),
(543, 'Is there a process for flowing down the corrective action requirement to a supplier when it is determined that the supplier is responsible? 是否有一個要求供應商採取糾正措施的程序？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 5),
(544, 'Is there a process for actions to be taken when timely or effective corrective actions are not achieved? 是否有一個程序確保糾正措施未能達到時得到糾正？', 'L', 'Y', '-', 0, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', 1, 5);
INSERT INTO `mc_master (1)` (`A`, `B`, `C`, `D`, `E`, `F`, `G`, `H`, `I`, `J`, `K`, `L`) VALUES
('1', 'Does the factory have a copy of valid laws and regulations on child labour and understand its requirements? 工廠有沒有一套有關童工的法律法規規定或清晰地理解有關童工的法律法規?', 'H', 'Y', '<中華人民共和國禁止使用童工規定法> China People''s Republic of prohibition of Child Labor ', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '14'),
('2', 'What is the legal youngest (minimum) age of workers? 法定的童工最低的年齡是什麼?', 'H', 'Y', '<中華人民共和國禁止使用童工規定法> China People''s Republic of prohibition of Child Labor ', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '14'),
('3', 'Does the factory have a copy of valid regulations and laws on young worker protection and understand its requirements? 工廠有沒有一套有關未成年工的法律法規規定或清晰地理解有關童工的法律法規?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '14'),
('4', 'Does the factory have effective procedures to verify the age of worker at the time of recruitment? 工廠有沒有一套程序文件有關核在新徵募職員時核對職員的年齡?', 'M', 'Y', '<中華人民共和國禁止使用童工規定法> China People''s Republic of prohibition of Child Labor ', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '14'),
('5', 'Does the factory keep adequate age-supporting documents of workers such as ID copies and personnel records? 工廠有沒有保留足夠的年齡證名文件,例如:身分證,員工記錄?', 'M', 'Y', '<中華人民共和國禁止使用童工規定法> China People''s Republic of prohibition of Child Labor ', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '14'),
('6', 'Is there a separate register required by law for young workers?有沒有法律規定未成年工必須有一個個別的登記記錄?', 'H', 'Y', '<中華人民共和國未成年人保護法> Republic of China on Protection of Young Workers Act', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '14'),
('7', 'Is separate register maintained for young workers? 未成年工有沒有一個個別的登記記錄?', 'H', 'Y', '<中華人民共和國未成年人保護法> Republic of China on Protection of Young Workers Act', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '14'),
('8', 'Is there any evidence identified that child labour is currently employed or has been employed in the past at the factory? 有沒有證據鑑定過去或現在有童工在工廠內工作的記錄?', 'H', 'Y', '<中華人民共和國禁止使用童工規定法> China People''s Republic of prohibition of Child Labor ', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '14'),
('9', 'Does the youngest age of workers at the factory comply with statutory & regulatory requirements? 工廠內最年輕的人員能否滿足法律法規要求?', 'H', 'Y', '<中華人民共和國未成年人保護法> Republic of China on Protection of Young Workers Act', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '14'),
('10', 'Are suspected young worker age records such as age certificate, local records or certificate from surgeon verified by the factory? 有嫌疑最年輕的人員的年齡證據名文件有否已被工廠證實?包括出世紙?', 'H', 'Y', '<中華人民共和國未成年人保護法> Republic of China on Protection of Young Workers Act', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '14'),
('11', 'Are young workers engaged in hazardous work? 未成年工有沒有比安排有危險的工作?', 'H', 'Y', '<中華人民共和國未成年人保護法> Republic of China on Protection of Young Workers Act', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '14'),
('12', 'Are young workers employed at night shift? 未成年工有沒有比安排夜班工作?', 'H', 'Y', '<中華人民共和國未成年人保護法> Republic of China on Protection of Young Workers Act', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '14'),
('13', 'What is the time of night shift as defined by local law? 法律法規定立夜班工作為什麼時候?', 'H', 'Y', '<中華人民共和國國務院關於職工工作時間的規定> Republic of China State Council regulations on working hours of employees', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '14'),
('14', 'Does the factory have a copy of valid laws and regulations on forced labor and understand its requirements? 工廠有沒有一套有關強迫和強制性勞動的法律法規規定或清晰地理解有關強迫和強制性勞動的法律法規?', 'L', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('15', 'Are all workers present voluntarily at the factory? 是不是所有的工人都是自動地在工廠工作?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('16', 'Are workers free to leave after working hours? 是不是所有的工人都可以在下班之後自由地出入工廠?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('17', 'Is there any restriction placed on leaving after working hours? 工人在下班之後有沒有地方不可以自由地出入?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('18', 'Where dormitories are present, are workers required to live in the dormitories without freedom of choice to live outside the factory? 如這間工廠是有宿舍，工人是否有選擇住在廠內或廠外的權利?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('19', 'When workers are in dormitories, is there any restriction placed on workers’ freedom of movement? 工人在宿舍裡，有沒有活動範圍限制規定?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('20', 'Are workers permitted time-off with doctor’s certificate or note when sick or for maternity? 工人如有醫生證明,可不可以請病假?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('21', 'Is there any evidence of physical or verbal abuse identified? 有沒有證據證明工廠內有肉體上或言語上的毀謗?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('22', 'Are workers forced to work overtime? 工人是不是被迫加班?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('23', 'Are employment contracts required by local law? 雇用合約是不是法律法規必須的?If employment contracts are required by law, does the law require that they shall be signed by both the factory AND the worker? 如雇用合約是法律法規必須的,那法規有沒有規定合約上必須有工廠及工人的簽署?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('24', 'Do all workers sign employment contracts with the factory? 是不是所有的工人都有跟工廠簽署雇用合約?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('25', 'Are employment contracts unfair or illegal? 工廠內的雇用合約是不是不公平的或不合法的?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('26', 'Is there any evidence identified that security guards were used to coerce workers? 工廠內的保安有沒有迫使工人做些什麼?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('27', 'Are workers required to lodge deposits such as illegal withholding of salary, training fee, employment broker fee, fee for tools, fee for uniforms, or original documents such as ID papers? 工人是否必須寄存個人的身份證/ 存款單收據在廠內,薪資,訓練費,器具費,制服費或其他的定金?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('28', 'Is there any physical method used to limit freedom of workers during working hours such as surveillance cameras or locked exit(s)? 工人的出入自由有沒有因為有攝像機或上鎖的出口而被限制?', 'H', 'Y', '<中華人民共和國勞動法 >Republic of China labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('29', 'Is there any evidence identified on the use of forced labour/ prison labour? 有沒有證據證明工廠使用監獄勞工/強迫勞工?', 'M', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '15'),
('30', 'Does the factory have a copy of valid laws and regulation on health and safety and understand its requirements? 工廠有沒有一份有關職業安全的法律及法規列表或完全地了解有關職業安全的法律及法規要求?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '11'),
('31', 'Is written health and safety policy posted and signed by top management? 職業安全的方針有沒有管理層簽名及招貼在車間內?', 'M', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '10'),
('32', 'Is safety committee established with members representing the various shifts, functions and levels? 職業安全委員會是否有不同班別，職務及級別的會員參與?', 'M', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '10'),
('33', 'Is a safety management representative for health & safety appointed? 有沒有任命一位高層管理人員參與職業安全委員會?', 'M', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '10'),
('34', 'Does the factory arrange health and safety training for new workers? 工廠有沒有安排職業安全培訓給與新工人?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '10'),
('35', 'Are training and awareness programs on health and safety arranged regularly for all workers? 工廠有沒有安排定時的職業安全培訓給工人?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '10'),
('36', 'Are accidents reported and recorded? 意外事故是否有被報告及記錄?', 'H', 'Y', '<職業病危害事故調查處理辦法>Occupational hazards approach to accident investigation', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('37', 'Does the factory keep injury / illness records such as daily injury and illness log, clinic records, injury statistics, illnesses report or any other safety statistics? 意外事故包括每日的損傷,會診,疾病或其他的記錄是否有被報導及記錄?', 'M', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('38', 'Is there any corrective actions taken to prevent recurrence of work related accidents? 意外事故發生後有沒有矯正的行動及預防意外再發生?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('39', 'Does the factory have valid fire inspection certificates which issued by local fire service authority? 工廠有沒有有效的消防檢查執照?', 'H', 'Y', '<建築設計防火規範> Building design for fire protection', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '11'),
('40', 'Does the factory have adequate number of fire extinguishers at each floor of building? 工廠有沒有足夠的滅火器在所有的車間?', 'M', 'Y', '<建築滅火器配置設計規範> Configuration design of building fire extinguishers', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('41', 'Does the number of fire extinguishers meet local legal requirements? 滅火器的數量能不能滿足法律法規要求?', 'M', 'Y', '<建築滅火器配置設計規範> Configuration design of building fire extinguishers', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '11'),
('42', 'Are all fire extinguishers inspected and tested regularly and ready to use at all times? 是不是所有的滅火器都有定時的檢查及測驗,準備好的?', 'M', 'Y', '<建築滅火器配置設計規範> Configuration design of building fire extinguishers', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('43', 'Is an effective fire extinguishing system ie fire hydrant/ fire hose or sprinkler installed at each floor of building and maintained properly? 是不是所有的滅火裝備,如:消防栓/水龍帶或灑水器都有定時的檢查?', 'M', 'Y', '<建築滅火器配置設計規範> Configuration design of building fire extinguishers', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('44', 'Are all fire extinguishing systems inspected and maintained properly? 是不是所有的滅火器都有定時的保養?', 'M', 'Y', '<建築滅火器配置設計規範> Configuration design of building fire extinguishers', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '11'),
('45', 'Is fire and hazard early warning system such as smoke detector installed and regularly tested? 火警報器及煙冒探測器有沒有安裝好及定期地測驗?', 'M', 'Y', '<建築滅火器配置設計規範> Configuration design of building fire extinguishers', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '11'),
('46', 'Are documented fire drills conducted regularly at least twice a year? 一年兩次的火警演習有沒有記錄?', 'H', 'Y', '<中華人民共和國消防法> Republic of China Prevention of Fire Safety ', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '11'),
('47', 'Are fire exits and escape routes adequate at each floor of building? 逃火通道及逃火路線是不是能滿足需要的?', 'M', 'Y', '<中華人民共和國消防法> Republic of China Prevention of Fire Safety ', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '11'),
('48', 'Is there any fire exit and escape route blocked or locked? 有沒有逃火通道被封住的或上鎖的?', 'M', 'Y', '<中華人民共和國消防法> Republic of China Prevention of Fire Safety ', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '11'),
('49', 'Is there any slide doors used at the factory? 工廠有沒有用滑動門? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('50', 'Are exits and fire exits identified with sign or indicator lamps? 出口及逃火通道有沒有標誌或燈箱表明?', 'M', 'Y', '<中華人民共和國消防法> Republic of China Prevention of Fire Safety ', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('51', 'Are adequate emergency lights installed at each floor of building? 是不是每層都有緊急照明燈?', 'M', 'Y', '<中華人民共和國消防法> Republic of China Prevention of Fire Safety ', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('52', 'Is the factory no more than 5 minutes away by fire engine from nearest fire station? 工廠是不是離最近的消防局5分鐘之內?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('53', 'Is there any fire accident take place in the past 12 months at the factory? 在過去12個月內工廠有沒有火警生?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('54', 'Does the factory have valid inspection certificates for boilers, elevators, pressure vessels and other equipment per local regulation? 工廠有沒有有效的檢查證明關於鍋爐,升降機,壓力容器及其他的設備?', 'H', 'Y', '<中華人民共和國消防法> Republic of China Prevention of Fire Safety ', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('55', 'Are the operators of above-mentioned equipment trained and qualified per local regulation? 那些設備的技工有沒有合格的證明?', 'M', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('56', 'Are adequate guarding or devices installed for moving/ rotating parts of machine, pulleys and belts or any other dangerous parts of machines? 旋轉機器,滑輪及帶動機器或其他的危險的機器有沒有保護設備?', 'L', 'Y', '<中華人民共和國安全生產法> Production Safety law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('57', 'Is there any instruction emphasized to prohibit loose clothing, jewellery or long hair near moving machinery? 有沒有有操作指南強調鬆掉了的織物,首飾或長髮不可接近移動的機器?', 'L', 'Y', '<中華人民共和國安全生產法> Production Safety law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '10'),
('58', 'Are all electricians, welding operators and forklift drivers trained and qualified per local regulations? 是不是所有的電工,焊接工及鏟車司機都有受訓及滿足當地的規章要求?', 'M', 'Y', '<中華人民共和國安全生產法> Production Safety law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '11'),
('59', 'Are electrical safety procedures implemented effectively to ensure safety precautions such as grounding, discharging, and testing to be taken? 電力安全程序文件是否確保把接地或安排適當的的安全試驗?', 'L', 'Y', '<中華人民共和國安全生產法> Production Safety law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '10'),
('60', 'Are all the electrical wires installed in fully acceptable condition and adequately protected? 所有的電線都必須在可以接受的狀態及提供充分的保護?', 'L', 'Y', '<中華人民共和國安全生產法> Production Safety law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('61', 'Are electrical installations are checked periodically and repairs carried out by competent electrician? 所有的電力裝置都必須定期接受檢查及由合資格電工修理?', 'M', 'Y', '<中華人民共和國安全生產法> Production Safety law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('62', 'Is hot work permit procedure implemented for welding, cutting and open flame operation at the factory? 有關焊接,切割及接觸火焰的程序文件是否有確保適當的許可證明?', 'L', 'Y', '<中華人民共和國安全生產法> Production Safety law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '10'),
('63', 'Are all site buildings maintained in good condition including both physical surface and structure? 是不是所有的建築物及場所保持恰當的狀態?', 'L', 'Y', '<中華人民共和國安全生產法> Production Safety law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('64', 'Is there any dangerous/hazardous substances used or stored at the factory? 工廠有沒有收存危險的物質?', 'M', 'Y', '<倉庫防火安全管理規則> Warehouse Fire Safety Management Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('65', 'Are these substances safely and securely stored? 那些物質是否有安全及穩固地存儲?', 'L', 'Y', '<倉庫防火安全管理規則> Warehouse Fire Safety Management Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('66', 'Is there any administration and engineering controls (reduced shift hours, ventilation fans and exhaust fans) being installed to reduce personal exposure? 有沒有施政及控制,如:減少工作時間,增加通風及風扇確保減少工人對危險的揭露狀態?', 'L', 'Y', '<中華人民共和國職業病防治法>Occupational Disease Prevention Law of PRC', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('67', 'Are appropriate personal protective equipment (PPE) such as goggles, glasses, gloves, earplug / muff, boots, or protective clothing provided by factory and in acceptable condition? 工廠有沒有提供可以接受的個人防護裝備,如:護目鏡,手套,耳塞,防護罩或其他的防護裝備?', 'L', 'Y', '<中華人民共和國職業病防治法>Occupational Disease Prevention Law of PRC', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('68', 'Is the air quality test regularly done? 有沒有定期的空氣檢驗?', 'L', 'Y', '<中華人民共和國職業病防治法>Occupational Disease Prevention Law of PRC', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('69', 'Is air quality test required by law? 空氣檢驗是不是法規要求?', 'H', 'Y', '<中華人民共和國職業病防治法>Occupational Disease Prevention Law of PRC', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('70', 'Does the factory have a suitable work environment in term of ventilation, temperature, lighting, cleanliness, and tidiness? 工廠有沒有合適的工作環境包括:通風,溫度,照明,潔淨及整齊?', 'L', 'Y', '<中華人民共和國職業病防治法>Occupational Disease Prevention Law of PRC', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('71', 'Does the factory arrange regular health examination for workers who worked in hazardous environment? 工廠有沒有安排正規健康檢查給在危險環境內工作的工人？', 'M', 'Y', '<中華人民共和國職業病防治法>Occupational Disease Prevention Law of PRC', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('72', 'Are there any evidences to verify that the workers’ health is not affected by hazardous factors? 有沒有證據證實工人的健康沒被危險的原素影響嗎？', 'L', 'Y', '<中華人民共和國職業病防治法>Occupational Disease Prevention Law of PRC', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('73', 'Does the factory have any occupational health inspection certificate issued by local government authority? 工廠有沒有由當地的政府發出的健康檢驗證明書?', 'H', 'Y', '<中華人民共和國職業病防治法>Occupational Disease Prevention Law of PRC', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('74', 'Are adequate first aid kits located at each factory floor and marked with signs? 工廠有沒有足夠及顯眼的急救藥箱在每層嗎？', 'M', 'Y', '<中華人民共和國職業病防治法>Occupational Disease Prevention Law of PRC', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('75', 'Does it have adequate workers being trained on first aid? 工廠有沒有足夠的工人受過急救訓練嗎？', 'H', 'Y', '<中華人民共和國職業病防治法>Occupational Disease Prevention Law of PRC', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('76', 'How many trained first aiders located at the factory? 工廠有多少個急救員？', 'L', 'Y', '<中華人民共和國職業病防治法>Occupational Disease Prevention Law of PRC', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('77', 'Is an in-house clinic/first aid station established with competent doctor/first aider employed at the factory? 工廠有沒有內部門診部或救護站及雇用有能力的醫生？', 'L', 'Y', '<中華人民共和國職業病防治法>Occupational Disease Prevention Law of PRC', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('78', 'Is a nearby medical centre/hospital/clinic available to factory? 附近有醫療中心/醫院/ 對工廠可提供的門診部嗎？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('79', 'Is potable water accessible and adequate at each floor of building? 在大樓的每層都可以飲用水嗎？', 'M', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('80', 'Are lavatory facilities accessible, clean and reasonable quantity at each floor of building? 在大樓的每層都有洗手間和打掃設備?', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('81', 'Do lavatory facilities meet or exceed local requirements?洗手間設備可不可以滿足本地要求？', 'M', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('82', 'Are toilets private and segregated for men and women?洗手間是男和女分開嗎？', 'M', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('83', 'Are washbasins and water taps available AND adequate? 臉盆和水龍頭是有提供和足夠的嗎？', 'M', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
