('85', 'Is there any legal requirement for kitchen and canteen with license? 廚房和食堂有沒有許可證的法規要求？If yes, does the factory have such a permit or license? 如有，工廠有這樣的一張許可證嗎？', 'H', 'Y', '<中華人民共和國清潔生產促進法> Cleaner Production Promotion Law of the China People''s Republic', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '11'),
('86', 'Is there any adequate evidences to identify workers who working in kitchen are suitable to food service such as health examination? 有足夠證據鑑定那些工人在廚房工作是合適的,如有定期地進行健康檢查？', 'M', 'Y', '<中華人民共和國清潔生產促進法> Cleaner Production Promotion Law of the China People''s Republic', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('87', 'Is there any food safety program established to ensure all the food and stuffs purchased from reliable sources? 食品的採購方案是否有保證所有的食物都是從可靠的源頭購買的？', 'M', 'Y', '<中華人民共和國清潔生產促進法> Cleaner Production Promotion Law of the China People''s Republic', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '10'),
('88', 'Is there any pest control program established and implemented effectively? 有害蟲控制程式被建立並且有效實施嗎？', 'L', 'Y', '<中華人民共和國清潔生產促進法> Cleaner Production Promotion Law of the China People''s Republic', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '10'),
('89', 'What is the average of dormitory space per worker?  Does it meet with local norms and standards? 每個工人宿舍空間的平均數是什麼？它能滿足本地的規範和標準嗎？', 'H', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('90', 'How many workers per room? 每房間多少工人？', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('91', 'Does the space per worker meet local laws or prevailing industry standards if no local laws apply? 每個工人宿舍空間能否滿足行業標準,如法律法規不適用？', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('92', 'Is it adequate living space for each worker and meet the requirements of relevant local regulations? 生活環境是否適合每個工人及能夠滿足法律法規要求?', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('93', 'Are there any recreation areas available at the dormitory? 有在宿舍範圍提供的娛樂場所嗎？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
