('95', 'Are there any laundry facilities available in dormitory? 在宿舍裡可提供的洗衣店設備嗎？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
