('97', 'Is it adequate toilets with hand basins available to workers with adequate distance at dormitory? 在宿舍裡有在距離的工人不遠的地方提供手盆及洗手間嗎？', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('98', 'Are there any adequate bathrooms available to workers at dormitory? 宿舍有對提供足夠的浴室嗎？', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('99', 'Are sanitary areas clean and hygienic with available washing facilities? 清洗的設備乾淨和衛生嗎？', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('100', 'Are the dormitories clean, safe and well lit? 宿舍是乾淨，安全並且有足夠照明的嗎？', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('101', 'Are workers free to exit & re-enter dormitory freely? 工人可以自由地出入宿舍嗎？', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('102', 'Is there any curfew hours set? 有沒有晚鐘時候?', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('103', 'When is the curfew hour? 什麼時候是晚鐘?', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('104', 'Are adequate security measures provided to protect workers at dormitory? 工廠有提供足夠的安全措施給在宿舍的工人嗎？', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('105', 'Does the dormitory buildings appear structurally sound with acceptable repairing? 那些宿舍大樓結構上還好嗎？', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('106', 'Are dormitory exits unblocked and unlocked for emergency evacuation? 宿舍出口是不是為緊急事件撤退而開啟的嗎？', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('107', 'Are written dormitory rules posted? 宿舍規章有沒有明確地顯示給工人嗎？', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '10'),
('108', 'Are the rules written in the language(s) in which the employees understand? 規章是不是用那些雇員可以理解的語言寫的?', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '10'),
('109', 'Are fire emergency evacuation plans posted at dormitory and understood by all workers? 緊急走火撤離計畫是否公佈在宿舍範圍內並且被全部工人理解嗎？', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '13'),
('110', 'Is there any workers’ dormitory located in the building of production and/or warehouse? 有工人的宿舍位於生產和倉庫的建築物裡面嗎？', 'L', 'Y', '<企業社會責任性準準則> Standard Criteria of Corporate Social Responsibility', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '3', '12'),
('111', 'Does the factory have a copy of valid laws and regulations on trade union and freedom of association and understand its requirements? 工廠有沒有一份有關工會及工人協會的法律及法規列表或完全地了解有關職業安全的法律及法規要求?', 'L', 'Y', '<中華人民共和國工會法> PRC Trade Union Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '16'),
('112', 'Does the workers have right to form and join free trade unions and workers'' associations acknowledged by the management and workers? 工人可不可以有權參加工會及工人協會?', 'L', 'Y', '<中華人民共和國工會法> PRC Trade Union Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '16'),
('113', 'Is there any trade union formed at the factory?  有工會在工廠成立嗎？If yes, is the union of membership voluntary? 如是對的，做協會的會員是自願的嗎？specify name and title. 名字和職責。', 'H', 'Y', '<中華人民共和國工會法> PRC Trade Union Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '16'),
('114', 'Is there any workers’ association formed in the factory? 有工人的協會在工廠成立嗎？If Yes, do workers elect their own representatives/ spokesperson? 如是對的，工人是不是可以選舉他們自己的代表/發言人嗎？ specify name and title. 名字和職責。', 'H', 'Y', '<中華人民共和國工會法> PRC Trade Union Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '16'),
('115', 'Could worker representatives access to members at workplace?工人代表可不可以進入工作場所能接觸工人？', 'H', 'Y', '<中華人民共和國工會法> PRC Trade Union Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '16'),
('116', 'Is there any evidence identified on disparate treatment between union/non-union workers? 有證據指出在工會/非工會的工人之間在不同的待遇嗎？', 'H', 'Y', '<中華人民共和國工會法> PRC Trade Union Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '16'),
('117', 'Does the factory have a written policy and procedure to protect worker from committee members, union supporters and/or Union representatives from retaliation? 工廠有沒有書面政策和程序文件保護委員會成員，協會支援者和/或協會眾議員, 預防受到報復？', 'H', 'Y', '<中華人民共和國工會法> PRC Trade Union Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '16'),
('118', 'If restricted by law or no formal workers union / association, does the factory facilitate alternative means such as worker committee? 如果因為法規理由不能建立工人協會/ 協會限制，工廠有沒有建立其它的形式,如工人委員會嗎？', 'H', 'Y', '<中華人民共和國工會法> PRC Trade Union Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '16'),
('119', 'For non-unionized factory, are fair and effective mechanisms to ventilate and resolve grievances of workers in place? 在沒有建立工人協會的工廠內，工人的冤情有沒有適當和公正及有效機製解決抱怨？', 'H', 'Y', '<中華人民共和國工會法> PRC Trade Union Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '16'),
('120', 'Does the factory allow/permit workers to choose a representative from their own group to facilitate communication with senior manager? 工廠是否允許工人從他們自己的組中挑選一名代表與經理層做聯繫工作嗎？', 'H', 'Y', '<中華人民共和國工會法> PRC Trade Union Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '16'),
('121', 'Does the factory encourage workers to formally join and carry out activities like complaints & resolutions of workers’ grievances, health & safety related activities, labour–management activities on productivity, etc.? 工廠鼓勵工人對正式參加並且進行活動包括抱怨議決,工人的冤情決議， 健康和安全在生產力上有關討論活動，等等嗎？', 'M', 'Y', '<中華人民共和國工會法> PRC Trade Union Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '16'),
('122', 'Has the factory experienced a strike, walkout, demonstration, or other significant conflict with employees within the last 12 months? 在過去12個月內工廠有經歷罷工，突然罷工，遊行示威還是與雇員的其他顯著的衝突嗎？', 'M', 'Y', '<中華人民共和國工會法> PRC Trade Union Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '16'),
('123', 'Interview with workers and representative(s) to confirm the above findings.  有與工人和代表會晤，並且確認上述結論。', 'M', 'Y', '<中華人民共和國工會法> PRC Trade Union Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '16'),
('124', 'Does the factory have a copy of valid laws and regulations on disciplinary practices and understand its requirements? 工廠有沒有一份有關懲罰的法律及法規列表或完全地了解有關懲罰的法律及法規要求?', 'L', 'Y', '<中華人民共和國勞動法> PRC Labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '18'),
('125', 'Does the factory have documented disciplinary rules? 工廠有沒有文件說明懲罰的規則?', 'M', 'Y', '<中華人民共和國勞動法> PRC Labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '18'),
('126', 'Are the disciplinary rules communicated to all workers? 懲罰的規則是否有效地通知所有的工人?', 'M', 'Y', '<中華人民共和國勞動法> PRC Labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '18'),
('127', 'Are the disciplinary rules fair, reasonable and legal or validated by local government authority? 懲罰的規則是否公正的及能夠滿足當地的法律及法規要求?', 'M', 'Y', '<中華人民共和國勞動法> PRC Labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '18'),
('128', 'Is there any evidence of mental / physical coercion? 有沒有證據證明存在精神上，言語上，性騷擾或強制勞動?', 'L', 'Y', '<中華人民共和國勞動法> PRC Labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '18'),
('129', 'Is there any evidence of deductions from salary for unable to meet production target or sickness with doctor''s certificate? 有沒有證據證明存在扣除薪水因為不能達到指標或是不能提供醫生的證明書?', 'H', 'Y', '<中華人民共和國勞動法> PRC Labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '18'),
('130', 'Are the worker’s disciplinary actions recorded? 工人的處分被記錄嗎？', 'H', 'Y', '<中華人民共和國勞動法> PRC Labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '18'),
('131', 'Could workers appeal in case of infractions / breach of rules? 如果違背/違例，工人能上訴嗎？', 'M', 'Y', '<中華人民共和國勞動法> PRC Labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '18'),
('132', 'Are deductions made from pay for infractions/ breach of rules?如果違背/違例，從薪水扣除違背/違例罰款嗎？', 'H', 'Y', '<中華人民共和國勞動法> PRC Labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '18'),
('133', 'If deductions are made from pay for infractions/ breach of rules, did they reduced pay that less than minimum wage? 如有從薪水扣除違背/違例罰款,最後的薪水是不是在最低薪資之下?', 'H', 'Y', '<中華人民共和國勞動法> PRC Labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '18'),
('134', 'Is it legal in deductions from pay for infractions/ breach of rules?從薪水扣除違背/違例罰款是合法的嗎?', 'H', 'Y', '<中華人民共和國勞動法> PRC Labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '18'),
('135', 'For deductions of pay from infractions or breach of rules, how is the money used? 對於從薪水扣除違背/違例罰款後, 錢是怎樣被使用？', 'L', 'Y', '<中華人民共和國勞動法> PRC Labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '18'),
('136', 'Is the factory free of any citation, penalty from violation of laws and regulations in past 12 month? 有沒有引證過，在過12個月有沒有因為違反法律法規而被懲罰？', 'H', 'Y', '<中華人民共和國勞動法> PRC Labour Law', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '18'),
('137', 'Does the factory have a copy of valid laws and regulations on working hours and understand its requirements? 工廠有沒有一份有關工時的法律及法規列表或完全地了解有關加班的法律及法規要求?', 'L', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('138', 'How many regular working hours are permitted by local law per day? (This does NOT include overtime) 當地的法規允許正常每日上班時間是多少小時? (不包括加班)', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('139', 'How many regular working hours are permitted by local law per week? (This does NOT include overtime) 當地的法規允許正常每週上班時間是多少小時? (不包括加班)', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('140', 'How many regular working hours are permitted by local law per month? (This does NOT include overtime) 當地的法規允許正常每月上班時間是多少小時? (不包括加班)', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('141', 'How many overtime hours are permitted by local law per day?當地的法規允許每日的加班時間是多少小時?', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('142', 'How many overtime hours are permitted by local law per week?當地的法規允許每週的加班時間是多少小時?', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('143', 'How many overtime hours are permitted by local law per month? 當地的法規允許每月的加班時間是多少小時?', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('144', 'Does the factory have a written policy on working hours, rest and vacations? 工廠有沒有確立政策，關於工作時間，休息和假期？', 'M', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('145', 'Does the factory communicate the policy of working hours, rest and vacations to all workers? 工廠確立的政策，關於工作時間，休息和假期有沒有跟工人傳達？', 'M', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('146', 'Does the policy of working hours meet local laws and regulations? 工作時間的政策能滿足本地法律法規要求嗎？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('147', 'Are the working hours of individual workers recorded by time card or attendance record? 工人的工作時間被記錄在考勤卡還是在出勤登記簿內？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('148', 'How long are the factory’s official working hours per week? 工廠的正常工作時間每周是多久？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('149', 'For working hours per week,  Does it meet local legal requirements? 工作時間以每周計算，它能滿足本地法律要求嗎？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('150', 'How long are the factory’s official working hours per month? 工廠的正常工作時間每月是多久？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('151', 'For working hours per month, Does it meet local legal requirements? 工作時間以每月計算，它能滿足本地法律要求嗎？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('152', 'Do the workers have at least one day (24 consecutive hours) off in seven days? 工人在7個工作天內有沒有一天休息?', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('153', 'What is the maximum number of working hours (including overtime) of individual workers per day? 個別的工人計算，最多一天的工作時間是多少(加班時間包括)？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('154', 'For the daily maximum number of working hours of individual workers (including overtime), does it meet local legal requirement? 最多一天的工作時間(加班時間包括) ，它能滿足本地法律要求嗎？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19'),
('155', 'What is the maximum number of working hours (including overtime) of individual workers per week? 個別的工人計算，最多一週的工作時間是多少(加班時間包括)？', 'H', 'Y', '<中華人民共和國勞動法第五章工資規定> PRC Chapter V Labor Law Minimum Wage Code', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '4', '19');
