('297', 'Are procedures utilized to document computer systems control - including safeguarding computer access?電腦系統的控制是否有程序文件- 包括維護電腦上網？', 'M', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '5', '28'),
('298', 'Does the organization have the quality management system with quality manual?組織有沒有質量管理體制及質量手冊？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('299', 'Is there any policy to address the need of quality, hygiene & good manufacturing practices?工廠有沒有質量方針，清潔衛生方針和GMP精益生產方針嗎？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('300', 'Does the quality manual define the documented procedure and reference to them?品質手冊有沒有識別出應有的程序文件?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('301', 'Is there any documented procedures to govern the operation of QMS?有沒有程序文件管理品質管理體系內的每個運作?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('302', 'Does the organization appoint a person who is in charge of the role of management representative to coordinate the issue of QMS with the concerned departments and parties?有沒有安排一個人負責做管理者代表, 負責任協調QMS與相關的部門？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('303', 'Are there any objectives/ KPI being established to monitor the performance of quality and control of hygiene/ GMP with improvement plan?有沒有確定品質目標與清潔衛生目標, 而及確定改進計劃?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('304', 'Did the organization review the QMS performance regularly including hygiene & GMP?組織會不會定期地檢閱QMS的實行情況包括:清潔衛生學& GMP方面？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('305', 'Is there any mechanism to monitor and measure the performance of continual improvement ?組織會不會有監控及數據度量持續改進？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('306', 'Did the organization routinely apply some quality tools to enhance quality performance, reducing breakdown rate, reducing the potential risk such as design of experiment (DOE), total preventive maintenance (TPM), failure mode & effect analysis(FMEA), Statistical Process Control (SPC), HACCP, etc?Are they running effectively?組織會不會使用一些提升質量性能的工具， 降低故障比率，降低潛在危險，例如實驗(DOE)的設計 ,預防性檢修(TPM) , (FMEA) ,統計過程控制(SPC) ,HACCP，等等嗎？如果有,那些工具是否有效地使用?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('307', 'Does the top management establish the organization chart that clearly depicts the hierarchy of the organization?最高管理層有否建立組織階層的組織結構圖？Are responsibilities and authorities defined and communicated by top management in each process/departments and function? 最高管理者有否確保組織內的職責、權限得到規定和溝通。', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('308', 'Is there any mechanism to detect and follow up the nonconforming product, hygiene & hazard problem?組織有否確保不符合產品要求的產品, 清潔衛生問題及危險情況得到識別和控制，以防止其非預期的使用或交付。', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('309', 'Is there any corrective & preventive action mechanism to control the quality problem, hygiene & hazard problem in order to avoid the recurrence?Are they running effectively？組織有否確定糾正及預防措施，(包括:清潔衛生問題及危險情況)以消除潛在不合格的原因，防止不合格的發生。如果有,那麼是否有效地使用?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('310', 'Is there any communication mechanism to clearly cascade the proved improvement action to the relevant parties in order to ensure the awareness to those one?組織內有否有建立適當的溝通過程，並確保對所有的糾正及預防措施都有有效性地進行溝通。 ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('311', 'Is there any document control system to ensure the latest version of document being used?有否有建立品質管理體系所要求的文件應予以控制, 確保文件的更新和現行修訂狀態得到識別', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('312', 'Did the organization regularly perform the internal audit to verify the compliance of QMS?組織有否按策劃定期地進行內部審核，以確定品質管理體系是否得到有效實施與保持。', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('313', 'Is company’s system on performing internal audits able to verify compliance with the principles of GMP?組織策劃的定期地內部審核，能否確定GMP得到有效實施與保持。', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('314', 'Is the boundary of factory free from debris and vegetation?工廠附近是不是沒有瓦礫和植物嗎？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('315', 'Is there any activity around the boundary of factory that could detrimentally affect the product such as polluted air or water are exhausted?工廠附近有沒有導致污染的機會,而影響產品包括:空氣,水', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('316', 'Is there any concrete path with at least 675 mm from the outer wall of all manufacturing areas? 是否有混凝土小徑在工廠外牆的６７５mm以外?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('317', 'For the waste containers, is there any mechanism to properly disposed it to ensure no pest induced from this origin?垃圾容器有否被正確整理防止害蟲的產生?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('318', 'For the loading & unloading area, is there any measure to protect the incoming material, Work-In-Process and finished goods free from contamination?在上貨和出貨的地區，有沒有標準確保進來的材料和製成品不會有污染或混亂？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('319', 'Is there any proof installation for the external door in order to avoid contamination?為了避免污染, 外面的門有沒有安裝預防裝備？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('320', 'For the inner wall surface, are they smooth, intact and easy to clean?內牆表面，平滑嗎，完整嗎和易於清潔嗎？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('321', 'For the floor, are they sealed without any gap and easily cleaned? No pooling of water appeared?地板, 是密封的嗎? 並且容易打掃? 有沒有水灘?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('322', 'For the drains, are they treated before drain out without any bad odour? 排水管有沒有先處理然後排放, 排放有沒有無臭味?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('323', 'For the ceiling, are they clean? Is there any mechanism to regularly clean any contamination?天花板，乾淨嗎？有製定期清潔嗎？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('324', 'For the windows, is it sealed and covered with anti-fly screen? 窗子，是否封好? 有沒有妨礙蠅類蟲害的紗窗？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29');
INSERT INTO `mc_master (1)` (`A`, `B`, `C`, `D`, `E`, `F`, `G`, `H`, `I`, `J`, `K`, `L`) VALUES
('325', 'For the windows, is it constructed of plastic or well protected against shattering?窗子，是否由塑膠建造還是好防碎的那個類？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('326', 'For the windows, is it clean during audit?窗子，在審核期間乾淨嗎？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('327', 'For the windows’ sill, is there any mechanism to regularly clean? Is it clean during audit?窗台，在審核期間乾淨嗎？有製定期清潔嗎？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('328', 'For the door in the production area, is it make from smooth impervious material with self-closing device?生產區域的門,是否用平滑不透氣並且有自動關閉的裝置?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('329', 'For the lighting in the production areas, is it sheathed or protected and free from debris?生產區域的燈,是否有覆蓋的並且不會產生碎片?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('330', 'In the production area, is there any wooden pallets and utensils?生產區域內,是用木製貨板或器皿的?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('331', 'In the shop floor area, is it well control with sterilization? 生產區域的區域是否有控制及消毒？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('332', 'In the shop floor area, Is there any areas that could induce the contamination of product such as hair, insect, etc?生產區域的區域是否有可能引起產品的污染(例如毛，昆蟲，等等)嗎？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('333', 'Is there any control to all notice boards and writing material control such as exclusion of drawing pins, pen tops, pencils, etc?佈告牌和圖釘，鋼筆頂，鉛筆，等等是否有控制？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('334', 'Is there any control in the adhesive tape?包裝膠紙有沒有控制?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('335', 'Is there any control against some filtering device for checking integrity of product such as sieves that might induce contamination built up or deterioration?有沒有對一些用作檢查產品有沒有變壞的設備進行控制?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('336', 'For the contact part with product in machinery, are they well maintained?與產品有接觸的機器是否有保養好?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('337', 'For the lubricants of machinery, is it using food grade oil?機器的潤滑劑，是否有使用食品等級的油？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('338', 'For the maintenance personnel, are they qualified to perform their duty in terms of quality, hygiene and GMP?維護人員，是否有資格依據質量，衛生和GMP 去執行他們的職責？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('339', 'How long does the metal detectors check with metal contaminated products? Could the facilities locate the metal contaminated products into the segregated containers?金屬檢測器會檢查產品的多久? 污染的產品是否會被隔離嗎？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '29'),
('340', 'Does the organization appoint a person to perform the hygiene control matter?有沒有安排一個人負責執行衛生控制事項？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '30'),
('341', 'Is there any policy for eating & drinking in the organization?工廠有沒有一個有關在廠內進食及飲料的政策?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '30'),
('342', 'Is there any designated area for drinking and eating?在廠內進食及飲料有沒有一個預設好的範圍?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '30'),
('343', 'Is there any documented policy for smoking in the organization? Any designated smoking area?工廠有沒有一個有關在廠內食煙的政策? 在廠內進食煙有沒有一個預設好的範圍?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '30'),
('344', 'Is there any requirement to prohibit wearing jewellery in the production areas?工廠內有沒有一個有關禁止戴著首飾的規定?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '30'),
('345', 'Is there any hygiene junction before entering to all manufacturing areas to ensure no hygiene problem such as washing facilities?工廠內有沒有一個清潔衛生間, 可在進入生產範圍前確保清潔衛生?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '30'),
('346', 'Is there any non-perfumed, biocidal hand sanitizer for use after hand washing before entering into the manufacturing area?在進入生產範圍前的清潔衛生間內有沒有能分解及沒酒精要素的消毒殺菌劑可供洗手?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '30'),
('347', 'Is there any mechanism to control effective use of protective clothing with hats covering clothing?有沒有機製確保防護衣, 防護帽子得到有效的使用？ ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '30'),
('348', 'Does the organization have adequate changing facilities?組織有足夠的更換設備嗎？ ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '30'),
('349', 'Is it effectively used and separated from the manufacturing areas?設備是否有效地被用及與生產區域分開?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '30'),
('350', 'Is the toilets maintained good sanitary standard? Is the location of toilet far away from the manufacturing area? i.e. there is no direct access into the manufacturing area from these facilities.洗手間是否堅持好衛生的標準？洗手間的位置遠離生產的地區嗎？如: 洗手間的位置和生產的地區是分隔的', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '30'),
('351', 'Does the visitor request to study the hygiene requirement before entering the manufacturing area?參觀者在進入生產場地之前有否要求參觀洗手間的衛生環境?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '30'),
('352', 'Is there any work instruction to govern the housekeeping issue in the shop floor before and after work such as 5S practices?有沒有像5S那些有關整理的指導書?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('353', 'Is there any inspection mechanism to check the cleanliness and record it accordingly?清潔及整理有沒有定期地檢查及記錄?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('354', 'Is there any periodic arrangement to conduct the full clean program to clean whole factory in order to eliminate the contamination?有沒有定期地全廠清潔及整理方案?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('355', 'Is there any mechanism to ensure no cleaning agents leaving on the surface of manufacturing equipment?有沒有確保沒有清潔劑遺留在機器的表面上?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('356', 'For the cleaning utensils and cleaning agent, is it stored in designated area to avoid product contamination?清潔劑有沒有預設好的範圍, 避免產品污染?', 'M', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('357', 'Is there any mechanism to control the production waste to remove regularly in order not to accumulate in the workshop?有沒有控制廢物的產生妨礙積聚在工廠內?', 'M', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '33'),
('358', 'Is there any mechanism to ensure adequate pest control including insect infestation, wild intruders by using an approved pest control contractor with documented site map? Any documented procedure to plan, conduct and follow up the reporting issue after each operation?有沒有害蟲控制方案或使用被認可的害蟲控制承包商?有不是程序文件?跟進計劃?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '32'),
('359', 'Did the organization place the mice cages with bait in the specified areas using appropriate labels?工廠內有沒有老鼠籠並且有適當的標籤? ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '32'),
('360', 'Is there any First In First Out (FIFO) mechanism that monitored and verified the raw material, Work-In-Process (WIP) and finished goods entering and dispatching from the warehouse in sequence manner with labelled date code?有沒有(先進先出) 或類似的監控? (包括:原料,半完成品, 製成品) 從倉庫那裡發送的順序與貼標籤日期代碼連接的', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '31'),
('361', 'Is the any mechanism to monitor the temperature of warehouse regularly? Is it effectively running? Is the temperature measuring equipment calibrated appropriately? 是否有定期監控倉庫的溫度的機製嗎？它有有效地進行嗎？測量溫度的設備有被校驗嗎？  ', 'M', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '31'),
('362', 'Is the finished product stored separately from raw material? Are both of these items separated from non-food chemicals?原料與最終產品分別儲存的嗎？這兩類與非食品的化學製品分離嗎？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '31'),
('363', 'Is there any quarantine areas clearly identified and used as intended for products on hold/ pending approval/ returned products?存貨有沒有分類及明確地識別?(包括:留住, 等候批准,被送回的,其他…)', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '31'),
('364', 'Are all incoming materials accompanied by a COA (Certificate of Analysis) where required? Are these records kept on file?是不是所有的來料都有COA(化驗證明書)?如:需要時. 這些記錄被存檔嗎？', 'M', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '31'),
('365', 'Did the organization appropriately label the finished product with material description, supplier name, date of manufacture, batch number, quantity and date -code number?組織有沒有標籤最終產品包括:物質描述，供應者名字，製造，批號，數量和日期嗎？', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '31'),
('366', 'Is there any wooden pallets used in the storage area?倉庫有沒有用木製的貨板?', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '6', '31'),
