('442', 'Is the documenting of information to monitor performance, applicable operational controls and conformity with the organization''s environmental objectives and targets? 是否包括目標指標完成情況的監測', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '2', '9'),
('443', 'Has the organization shall ensure that calibrated or verified monitoring and measurement equipment is used and maintained and shall retain associated records? 是否規定監測設備的校準和維護及其記錄', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '2', '9'),
('444', 'Is there consistent with its commitment to compliance, the organization shall establish, implement and maintain a procedure(s) for periodically evaluating compliance with applicable legal requirements? 有否定期評審法律法規符合性的程序', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '2', '7'),
('445', 'Has the organization been established, implement and maintain a procedure(s) for dealing with actual and potential nonconformity(ies) and for taking corrective action and preventive action? 有否明確調整和處理不符合糾正與預防再可能發生的職責和權限', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '2', '6'),
('446', 'Has the organization ensured that internal audits of the environmental management system are conducted at planned intervals? 有否規定審核頻次和審核計劃(集中式或分散式)', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '2', '9'),
('447', 'Has the top management reviewed the organization''s environmental management system, at planned intervals, to ensure its continuing suitability, adequacy and effectiveness. Reviews shall include assessing opportunities for improvement and the need for changes to the environmental management system, including the environmental policy and environmental objectives and targets? 管理評審的內容是否包括根據審核結果客觀變化方針承諾為而引發對方針目標指標EMS其他要素修正的要求和指示', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '2', '9'),
('448', 'Has the organization established, documented, implemented and maintained a quality management system and continually improve its effectiveness?組織有否建立質量管理體系，形成文件，加以實施和保持，並保持其有效性', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '1'),
('449', 'Has the organization established and maintained a quality  manual that includes the scope of the quality management system, including a description of the interaction between the processes of the quality management system?組織有否編制和保持質量手冊，質量手冊有否包括質量管理體系過程之間的相互作用的表述', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '1'),
