('499', 'Does production documentation contain the following: A. drawings, parts list, process flow charts, etc. B. A list of specific or non-specific tools and numerical control machines programs and instructions? 是否生產文件包含如下：A.圖紙，零件清單，工藝流程圖，B.特定或不特定的工具和數控機床的方案和說明？ ', 'L', 'Y', '-', '0', '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '4'),
